Zhejing cuisine is known for its unique flavors and cooking techniques. The four main styles are: 1) Jiangnan (south of the Yangtze River), which focuses on seafood and rice dishes; 2) Hangzhou, which is famous for dishes like Peking duck and hot pot;
3) Zhaozhou, known as the 'capital of Chinese cuisine' and famous
for dishes such as braised pork belly and braized fish; and 4)
Wenzhou style, characterized by its spicy and salty flavors.
